DROP TABLE IF EXISTS `lmb_goods`;
CREATE TABLE `lmb_goods` (
  `goods_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'V店商品id',
  `goods_sn` varchar(45) NOT NULL DEFAULT '' COMMENT 'V店编号',
  `bind_goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联的原商品id',
  `bind_goods_sn` varchar(45) NOT NULL DEFAULT '' COMMENT '关联的原商品编码',
  `shop_sn` varchar(20) NOT NULL DEFAULT '' COMMENT 'v店编码',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT 'v店id',
  `shop_name` varchar(64) NOT NULL DEFAULT '' COMMENT 'v店名称',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `add_user` varchar(40) NOT NULL DEFAULT '' COMMENT '添加人',
  `update_time` int(11) NOT NULL DEFAULT '0' COMMENT '更新时间',
  `update_user` varchar(40) NOT NULL DEFAULT '' COMMENT '更新人',
  `market_price` decimal(10,2) NOT NULL DEFAULT '2.00' COMMENT '市场售价',
  `sale_price` decimal(10,2) NOT NULL DEFAULT '2.00' COMMENT '销售价',
  `goods_name` varchar(100) NOT NULL DEFAULT '' COMMENT '商品名称',
  `platform` tinyint(4) NOT NULL DEFAULT '0' COMMENT '所属平台',
  `business_type` tinyint(4) NOT NULL COMMENT '0、仓储直配 1、第3方发货 2、保税区发货 3、海外直邮',
  `lamall_price` decimal(10,2) NOT NULL DEFAULT '2.00' COMMENT '商城售价',
  `merchant_price` decimal(10,2) NOT NULL DEFAULT '2.00' COMMENT '对商家的售价',
  `is_on_sale` tinyint(4) NOT NULL DEFAULT '1' COMMENT ' 1上架,0下架',
  `code_img` varchar(150) NOT NULL DEFAULT '' COMMENT '二维码图片url',
  PRIMARY KEY (`goods_id`),
  UNIQUE KEY `goods_sn` (`goods_sn`)
) ENGINE=InnoDB AUTO_INCREMENT=449 DEFAULT CHARSET=utf8 COMMENT='V店平台商品表';

