  `shop_sn` varchar(11) NOT NULL DEFAULT '' COMMENT '商铺编码',
  `shop_logo` varchar(100) NOT NULL DEFAULT '' COMMENT '店铺LOGO',
  `shop_intro` varchar(200) NOT NULL DEFAULT '' COMMENT '店铺简介',
  `shop_status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '店铺状态:1-正常 2-关闭 3-合作过期',
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '商家ID',
  `platform` tinyint(4) NOT NULL COMMENT '1-V店平台',
  `merchant_contact_person` varchar(20) NOT NULL DEFAULT '' COMMENT '商家联系人',
  `merchant_contact_phone` varchar(20) NOT NULL DEFAULT '' COMMENT '商家联系电话',
  `shop_contact_person` varchar(20) NOT NULL DEFAULT '' COMMENT '平台联系人',
  `shop_contact_phone` varchar(20) NOT NULL DEFAULT '' COMMENT '平台联系电话',
  `prov_id` varchar(10) NOT NULL DEFAULT '' COMMENT '省编号',
  `city_id` varchar(10) NOT NULL DEFAULT '' COMMENT '城市编号',
  `dist_id` varchar(10) NOT NULL DEFAULT '' COMMENT '区域编号',
  `add_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  `update_id` int(11) NOT NULL DEFAULT '0' COMMENT '修改人',
  `return_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '用户退货地址',
  `saler_id` int(11) NOT NULL DEFAULT '0' COMMENT '业务人员id',
  `shop_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '店铺类型',
