  PRIMARY KEY (`shop_id`),
  UNIQUE KEY `shop_sn` (`shop_sn`)
) ENGINE=InnoDB AUTO_INCREMENT=1000136 DEFAULT CHARSET=utf8 COMMENT='店铺基本信息';

