-- ----------------------------
-- Table structure for lmb_web_ad
-- ----------------------------
DROP TABLE IF EXISTS `lmb_web_ad`;
CREATE TABLE `lmb_web_ad` (
  `ad_id` smallint(5) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `ad_type` smallint(5) unsigned NOT NULL DEFAULT '1' COMMENT '广告位ID 1-商城banner 2-签到广告 3-H5顶部 4-H5底部 5-商城注册登录页 6-APP中部广告 7-APP置顶广告',
  `ad_name` varchar(60) NOT NULL DEFAULT '' COMMENT '广告名称',
  `ad_link` varchar(255) NOT NULL DEFAULT '' COMMENT '广告链接',
  `cate_id` int(11) NOT NULL DEFAULT '0' COMMENT '分类id，当选择分类广告时填写',
  `pc_ad_link` varchar(255) NOT NULL DEFAULT '' COMMENT 'pc商城广告链接',
  `pc_banner` varchar(255) NOT NULL COMMENT 'PC 广告图',
  `pc_banner_small` varchar(255) NOT NULL COMMENT 'pc 背景图',
  `ad_img` varchar(255) NOT NULL COMMENT '广告图片',
  `ad_new_img` varchar(255) NOT NULL DEFAULT '0' COMMENT '新版广告图片',
  `ad_code` text NOT NULL COMMENT '广告地图代码',
  `start_time` int(11) NOT NULL DEFAULT '0' COMMENT '开始时间',
  `end_time` int(11) NOT NULL DEFAULT '0' COMMENT '结束时间',
  `link_man` varchar(60) NOT NULL DEFAULT '' COMMENT '联系人',
  `link_email` varchar(60) NOT NULL DEFAULT '' COMMENT '联系Email',
  `link_phone` varchar(60) NOT NULL DEFAULT '' COMMENT '系联电话',
  `click_count` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '击点次数',
  `enabled` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '启用状态 1 开启 0 不开启',
  `weight` int(11) NOT NULL COMMENT '权重',
  `sort_order` tinyint(3) NOT NULL DEFAULT '0' COMMENT '排序ID',
  `typeid` tinyint(1) NOT NULL DEFAULT '1' COMMENT '广告类型 1-电商首页 2-专题卖场 3-商品分类界面 4-商品详细界面 5-特卖详情 6-链接',
  `rec_type` varchar(100) NOT NULL DEFAULT '' COMMENT '0 默认推荐 ，1宝宝1--3月， 2宝宝3--6月， 3宝宝 6--12月， 4孕早期 ， 5孕中期， 6孕晚期, 7备孕中 8 成人',
  PRIMARY KEY (`ad_id`),
  KEY `position_id` (`ad_type`),
  KEY `enabled` (`enabled`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='广告表';

