-- ----------------------------
-- Procedure structure for sp_demo
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_demo`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `sp_demo`()
BEGIN
 declare order_type int;
 if order_type = 3 then
	select * from lmb_order_info where pay_status<>0;
 else
    select * from lmb_order_info;

 end if;
END
;;
DELIMITER ;
